create table PCEINTERNADOS
(
  NUM_TRANSFERENCIA        NUMBER(8) not null
    primary key,
  INT_EPISODIO             NUMBER(8),
  COD_ESPECIALIDADE        NUMBER(5),
  DES_ESPECIALIDADE        VARCHAR2(50),
  COD_ESPECIALIDADE_PREV   NUMBER(5),
  DESC_ESPECIALIDADE_PREV  VARCHAR2(50),
  COD_MEDICO               NUMBER(5),
  DTA_SAIDA                DATE,
  HORA_SAIDA               NUMBER(5),
  COD_SERVICO_UNIDADE      CHAR,
  COD_UNIDADE_INTER        NUMBER(2),
  DES_UNIDADE_INTER        VARCHAR2(50),
  COD_SERVICO_UNIDADE_PREV CHAR,
  COD_UNIDADE_INTER_PREV   NUMBER(2),
  DES_UNIDADE_INTER_PREV   VARCHAR2(50),
  REMOVER                  NUMBER(1),
  MOTIVO_SAIDA             VARCHAR2(1)
)
/

create index ATM0015
  on PCEINTERNADOS (INT_EPISODIO)
/

